import React, { Component } from "react";


import data from "./data/data.json";


const newdata = data.map(data => {
  return (
    <body className="body">
      <div className="specials">

        <div>{data.name}</div>
        <div>{data.price}</div>
        <div>{data.desc}</div>
        <div>---------------</div>

      </div>
    </body>
  );
});

export default class Main extends Component {
  render() {
    return newdata;
  }
}
